import { Route, Routes } from "react-router-dom";
import Landing from "./MainLanding/Landing";
function App() {
  return (
    <Routes>
      <Route path="/" element={<Landing />} />
      <Route path="/auth" element={<Auth />}></Route>
    </Routes>
  );
}

export default App;
